export default function FreeSolo() {
  const [value,setValue]=useState('');
  const onChange=(e)=>{
    setValue(e.target.value);
  }
    return (
     <input type='text' value={value} label="What are you looking for..." variant="outlined"  onChange={onChange} />
    );
  }
